リバティLIFE STYLE FABRIC～2012AW～全柄全色を各1枚ずつセットした55枚セットです。<br /><br />
数量限定品ですので記念にもピッタリ、小物作りやパッチワークにも便利です。<br><br>
セット内容：約12cm×約12cm×55枚セット<br />
素材：綿100％(30スクエアシーチング地)<br /><br />
